  useEffect(() => {
    fetch("https://v6.exchangerate-api.com/v6/830c6d13ea14f7c7ad325357/latest/USD")
    .then ((res) => res.json())
    .then ((e) => {
      setData(e.conversion_rates)
    })

    console.log(data)
  })
  return (
    <div className="container">
      <Exchange/>
    </div>
  );
}

export default App;
